import React, { Component} from 'react';
import Navigation from './Navigation.js';
import './App.css';



class Homepage extends Component{
  render(){
    return(
      <div>
        <div class="homepage_image" >
          <h1>ברוכים הבאים</h1>
          <h1> למזון שפיים</h1>

        </div>
        <br></br>
        <br></br>
        <br></br>

        <div class="new_messages" Style="float:Right">
        <h1 Style="direction:rtl">הודעות חדשות</h1>
        <ul Style="dir:rtl">ֿ
        <li> עדכוני קורונה - בהתאם להוראות משרד הבריאות, הכניסה למרכול תאפשר רק אחרי מדידית חום ועם מסיכה</li>
          <li> עדיין ניתן לבצע משלוחים מהמרכול. להזמנות שלחו את הטופס הבא</li>
          <li> ביום שישי ה - 27.3 נערוך ארוחת שיש בחדר אוכל. מוזמנים להרשם כאן.</li>
        </ul>
        </div>
      </div>

    );
    }
  }

class App extends Component{
  render (){
    return(
      <div>
        <div>
          <Navigation></Navigation>
        </div>
        <div>
          <Homepage></Homepage>
        </div>
    </div>
    )
  }
}

export default App;
